import axios from "axios";
import React, { useEffect, useState } from "react";
const getApiPhotos = () => {
  axios
    .get("https://picsum.photos/v2/list")
    .then(function (res) {
        console.log(res);
      return res;
    })
    .catch(function (err) {
      console.log(err);
    });
};

const Picsum_Photos = () => {
//   const [photos, setPhoto] = useState();
  useEffect(() => {
    getApiPhotos().then((value) => {
        console.log(value);
    })
  }, []);
  return (
    <div>
      <h1 className="text-center text-blue-300">Le pham trung duong</h1>
    </div>
  );
};

export default Picsum_Photos;
